    <style>
    
    
    @media(max-width:992px) {
        
        #flex1{
            display: grid;

        }
        
        #kol{
            text-shadow: 0 0 black;
              font-size: 2.5rem;
    color: #24717b !important;
        }
        
        #mobmenu {
    display: block !important;
}


     .app-header .app-header__mobile-menu  , .app-header__menu{
        display: none !important;
    }
    
    
     .fixed-sidebar.fixed-header .app-sidebar .app-header__logo  ,  .app-header .header-shadow , #br{
        display: block !important;
    }
}


#uii , #br,  #mobmenu{
    display:none;
}
    
    .read-icon{
        margin-right: -3rem;

        background-color: #fff;
   background-image: url("https://amymhaddad.s3.amazonaws.com/morocco-blue.png");
    cursor: pointer;
    width: 16px;
    border-radius: 6px;
    height: 16px;
    float: right;
    border: none !important;
    padding: 0px !important;
    padding-bottom: 0px !important;
    margin-left: 5px;
    display: block;
    }
    
 
    .flexigrid .edit-icon {
    background-image: url("https://amymhaddad.s3.amazonaws.com/oriental-tiles.png");
  background-color: #fff;
    cursor: pointer;
    border-radius: 6px;
    width: 16px;
    height: 16px;
    float: right;
    border: none !important;
    padding: 0px !important;
    padding-bottom: 0px !important;
    margin-left: 5px;
    display: block;
}
    
    #form-button-save , #save-and-go-back-button , #cancel-button{
            margin-left: 0.7rem;
    float: right;
    background-color: #8fd23c;
    border-radius: 1rem;
    width: auto;
    padding: 5px;
    font-size: 1rem;
    font-weight: bolder;
    }
    
    
    #FormLoading{
        display:none;
    }
    .bDiv{
            padding-top: 4rem;
    }
    
    th {
    border: 2px solid;
    text-align: end;
    padding-right: 3rem;
    padding-top: 2rem;
    border-color: #288a97;
}

td {
    border: 2px solid;
    text-align: end;
    padding-right: 3rem;
    padding-top: 2rem;
    border-color: #288a97;
}


#search_field{
      margin-left: 4rem; 
}


.pGroup{
       margin-top: 1rem;
    margin-bottom: 1rem;
}


#quickSearchBox{
        margin-top: 1rem;
    margin-bottom: 1rem;
}

.search-div-clear-button{
      margin-top: 1rem;   
}
    
    #filtering_form{
        margin-left: 1rem;    
    }
    
    #ajax_list{
        margin-bottom: 2.5rem;
    }
    
    .fbutton{
                margin-left: 0.7rem;
            float: right;
    background-color: #8fd23c;
    border-radius: 1rem;
    width: auto;
    padding: 5px;
    font-size: 1rem;
    font-weight: bolder;    
    }
    
    #logout {
    font-size: 0.9rem;
    font-weight: bolder;
}
    
    #tot{
            margin-right: -2rem;
    }
    #ah:hover {
  background-color: #8fd23c;
      padding-top: 0.2rem;
          padding-bottom: 0.2rem;
}


   #ah2:hover {
  background-color: #8fd23c;
  padding-top: 0.2rem;
          padding-bottom: 0.2rem;
}


   #dbb2:hover {
  background-color: #8fd23c;
  padding-top: 0.3rem;
          padding-bottom: 0.3rem;
}


        .logoi{
            height: auto;
    width: 11rem;
        }
        
         #dbb{
            height: auto;
    width: 1.8rem;
        }
        
        
         #dbb2{
            height: auto;
    width: 1.2rem;
    margin-left: 0.5rem !important;
        }
        
        
        #fg{
           margin-top: 0.4rem;
    font-weight: bolder;
    font-size: 0.9rem;
        }
        
      
        #ah{
           margin-left: 1rem;
    font-weight: bolder;
    font-size: 0.9rem;
        }
        
        #ah2{
            margin-left: 2rem;
    font-weight: bolder;
    font-size: 1rem;
        }
        
        
        a , p, body, html , div{
            font-family: emoji !important;
