ul.fancytree-container {
    font-family: tahoma, arial, helvetica;
    font-size: 10pt;
    white-space: nowrap;
    padding: 3px;
    margin: 0;
    background-color: #fff;
    border: 1px dotted gray;
    min-height: 0%;
