.app-container {
    display: flex;
    min-height: 100vh;
    flex-direction: column;
    margin: 0
}

.icon-anim-pulse {
    animation: pulse_animation;
    animation-duration: 1000ms;
    animation-iteration-count: infinite;
    animation-timing-function: linear
}

@keyframes pulse_animation {
    0% {
        transform: scale(1)
    }
    30% {
        transform: scale(1.1)
    }
    40% {
        transform: scale(1.21)
    }
    50% {
        transform: scale(1)
    }
    60% {
        transform: scale(1)
    }
    70% {
        transform: scale(1.09)
    }
    80% {
        transform: scale(1.05)
    }
    100% {
        transform: scale(1)
    }
}

.SidebarAnimation-appear {
    transform: translateX(-30px);
    opacity: 0
}

.SidebarAnimation-appear.SidebarAnimation-appear-active {
    opacity: 1;
    transform: translateX(0);
    transition: all .4s linear
}

.HeaderAnimation-appear {
    transform: translateY(-30px);
    opacity: 0
}

.HeaderAnimation-appear.HeaderAnimation-appear-active {
    opacity: 1;
    transform: translateY(0);
    transition: all .4s linear
}

.MainAnimation-appear {
    transform: translateY(-30px);
    opacity: 0
}

.MainAnimation-appear.MainAnimation-appear-active {
    opacity: 1;
    transform: translateY(0);
    transition: all .4s linear
}

