.ps__rail-y:hover,
.ps__rail-x:focus,
.ps__rail-y:focus {
    background-color: rgba(0, 0, 0, .1);
    opacity: .9
}

.ps__thumb-x {
    background-color: rgba(0, 0, 0, .1);
    border-radius: 6px;
    transition: background-color .2s linear, height .2s ease-in-out;
    height: 6px;
    bottom: 2px;
