.datepicker-container {
    background-color: #fff;
    direction: ltr;
    left: 0;
    position: fixed;
    -webkit-tap-highlight-color: transparent;
    top: 0;
    line-height: 34px;
    touch-action: none;
    -webkit-touch-callout: none;
    user-select: none;
    width: 276px;
    z-index: -1
}

.datepicker-container::before,
.datepicker-container::after {
    border: 10px solid transparent;
    content: " ";
    display: block;
    height: 0;
    position: absolute;
    width: 0
}

.datepicker-dropdown {
    position: absolute;
    top: 100%;
    left: 0;
    z-index: 1000;
    padding: 4px;
    margin: .125rem 0 0;
    font-size: .88rem;
    color: #495057;
    text-align: left;
    list-style: none;
    background-color: #fff;
    background-clip: padding-box;
    border: 1px solid rgba(0, 0, 0, .15);
    border-radius: .25rem;
    box-shadow: 0 .46875rem 2.1875rem rgba(4, 9, 20, .03), 0 .9375rem 1.40625rem rgba(4, 9, 20, .03), 0 .25rem .53125rem rgba(4, 9, 20, .05), 0 .125rem .1875rem rgba(4, 9, 20, .03)
}

.datepicker-inline {
    position: static;
    margin: 0 auto;
    border: 1px solid rgba(0, 0, 0, .15);
    border-radius: .25rem;
    padding: 4px
}

.datepicker-top-left,
.datepicker-top-right {
    border-top-color: rgba(0, 0, 0, .15)
}

.datepicker-top-left::before,
.datepicker-top-left::after,
.datepicker-top-right::before,
.datepicker-top-right::after {
    border-top: 0;
    left: 10px;
    top: -11px
}

.datepicker-top-left::before,
.datepicker-top-right::before {
    border-bottom-color: rgba(0, 0, 0, .15)
}

.datepicker-top-left::after,
.datepicker-top-right::after {
    border-bottom-color: #fff;
    top: -10px
}

.datepicker-bottom-left,
.datepicker-bottom-right {
    border-bottom-color: #3f6ad8
}

.datepicker-bottom-left::before,
.datepicker-bottom-left::after,
.datepicker-bottom-right::before,
.datepicker-bottom-right::after {
    border-bottom: 0;
    bottom: -11px;
    left: 10px
}

.datepicker-bottom-left::before,
.datepicker-bottom-right::before {
    border-top-color: #3f6ad8
}

.datepicker-bottom-left::after,
.datepicker-bottom-right::after {
    border-top-color: #fff;
    bottom: -10px
}

.datepicker-top-right::before,
.datepicker-top-right::after,
.datepicker-bottom-right::before,
.datepicker-bottom-right::after {
    left: auto;
    right: 10px
}

.datepicker-panel>ul {
    margin: 0;
    padding: 0
}

.datepicker-panel>ul::before,
.datepicker-panel>ul::after {
    content: " ";
    display: table
}

.datepicker-panel>ul::after {
    clear: both
}

.datepicker-panel>ul>li {
    background-color: #fff;
    cursor: pointer;
    float: left;
    height: 34px;
    list-style: none;
    margin: 2px;
    padding: 0;
    text-align: center;
    width: 34px;
    border-radius: .25rem;
    transition: all .2s
}

.datepicker-panel>ul>li:hover {
    background-color: #3f6ad8;
    color: #fff
}

.datepicker-panel>ul>li.muted {
    color: #ced4da
}

.datepicker-panel>ul>li.muted:hover {
    background: #f8f9fa;
    color: #adb5bd
}

.datepicker-panel>ul>li.highlighted {
    background-color: #f7b924;
    color: #212529
}

.datepicker-panel>ul>li.highlighted:hover {
    background-color: #f7b924;
    color: #212529
}

.datepicker-panel>ul>li.picked,
.datepicker-panel>ul>li.picked:hover {
    background: #3ac47d;
    color: #fff
}

.datepicker-panel>ul>li.disabled,
.datepicker-panel>ul>li.disabled:hover {
    background-color: #f8f9fa;
    color: #ced4da;
    cursor: default
}

.datepicker-panel>ul>li.disabled.highlighted,
.datepicker-panel>ul>li.disabled:hover.highlighted {
    background-color: #e9ecef;
    color: #adb5bd
}

.datepicker-panel>ul>li[data-view="years prev"],
.datepicker-panel>ul>li[data-view="year prev"],
.datepicker-panel>ul>li[data-view="month prev"],
.datepicker-panel>ul>li[data-view="years next"],
.datepicker-panel>ul>li[data-view="year next"],
.datepicker-panel>ul>li[data-view="month next"],
.datepicker-panel>ul>li[data-view=next] {
    font-size: 18px
}

.datepicker-panel>ul>li[data-view="years current"],
.datepicker-panel>ul>li[data-view="year current"],
.datepicker-panel>ul>li[data-view="month current"] {
    width: 186px
}

.datepicker-panel>ul[data-view=years]>li,
.datepicker-panel>ul[data-view=months]>li {
    height: 52.5px;
    line-height: 52.5px;
    width: 62.5px
}

.datepicker-panel>ul[data-view=week]>li,
.datepicker-panel>ul[data-view=week]>li:hover {
    background-color: #fff;
    cursor: default;
    color: #6c757d
}

.datepicker-hide {
    display: none
}

.daterangepicker {
    position: absolute;
    top: 100%;
    left: 0;
    z-index: 1000;
    padding: 0;
    margin: .125rem 0 0;
    font-size: .88rem;
    color: #495057;
    text-align: left;
    list-style: none;
    background-color: #fff;
    background-clip: padding-box;
    border: 1px solid rgba(0, 0, 0, .15);
    border-radius: .25rem;
    box-shadow: 0 .46875rem 2.1875rem rgba(4, 9, 20, .03), 0 .9375rem 1.40625rem rgba(4, 9, 20, .03), 0 .25rem .53125rem rgba(4, 9, 20, .05), 0 .125rem .1875rem rgba(4, 9, 20, .03);
    display: none
}

.daterangepicker:before,
.daterangepicker:after {
    position: absolute;
    display: inline-block;
    border-bottom-color: rgba(0, 0, 0, .15);
    content: ''
}

.daterangepicker:before {
    top: -10px;
    border-right: 10px solid transparent;
    border-left: 10px solid transparent;
    border-bottom: 10px solid rgba(0, 0, 0, .15)
}

.daterangepicker:after {
    top: -9px;
    border-right: 10px solid transparent;
    border-bottom: 10px solid #fff;
    border-left: 10px solid transparent
}

.daterangepicker.opensleft:before {
    right: 9px
}

.daterangepicker.opensleft:after {
    right: 10px
}

.daterangepicker.openscenter:before {
    left: 0;
    right: 0;
    width: 0;
    margin-left: auto;
    margin-right: auto
}

.daterangepicker.openscenter:after {
    left: 0;
    right: 0;
    width: 0;
    margin-left: auto;
    margin-right: auto
}

.daterangepicker.opensright:before {
    left: 9px
}

.daterangepicker.opensright:after {
    left: 9px
}

.daterangepicker.drop-up {
    margin-top: -11px
}

.daterangepicker.drop-up:before {
    top: initial;
    bottom: -11px;
    border-bottom: initial;
    border-top: 10px solid rgba(0, 0, 0, .15)
}

.daterangepicker.drop-up:after {
    top: initial;
    bottom: -10px;
    border-bottom: initial;
    border-top: 10px solid #fff
}

.daterangepicker.single .daterangepicker .ranges,
.daterangepicker.single .drp-calendar {
    float: none
}

.daterangepicker.single .drp-selected {
    display: none
}

.daterangepicker.show-calendar .drp-calendar {
    display: block
}

.daterangepicker.show-calendar .drp-buttons {
    display: block
}

.daterangepicker.auto-apply .drp-buttons {
    display: none
}

.daterangepicker .drp-calendar {
    display: none;
    max-width: 270px
}

.daterangepicker .drp-calendar.left {
    padding: 8px 0
}

.daterangepicker .drp-calendar.right {
    padding: 8px
}

.daterangepicker .drp-calendar.single .calendar-table {
    border: none
}

.daterangepicker .calendar-table .next span,
.daterangepicker .calendar-table .prev span {
    color: #fff;
    border: solid #343a40;
    border-width: 0 2px 2px 0;
    border-radius: 0;
    display: inline-block;
    padding: 4px
}

.daterangepicker .calendar-table .next:hover span,
.daterangepicker .calendar-table .prev:hover span {
    border: solid #fff;
    border-width: 0 2px 2px 0
}

.daterangepicker .calendar-table .next span {
    transform: rotate(-45deg);
    -webkit-transform: rotate(-45deg)
}

.daterangepicker .calendar-table .prev span {
    transform: rotate(135deg);
    -webkit-transform: rotate(135deg)
}

